control.onControlLoad:
//鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 11; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 11; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.id = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.f1 = g5.dataset1.getData(5, sender.rowIndex);
    g5.f2 = g5.dataset1.getData(2, sender.rowIndex);
    g5.f3 = g5.dataset1.getData(26, sender.rowIndex);
    g5.f4 = g5.dataset1.getData(27, sender.rowIndex);
    g5.f5 = g5.dataset1.getData(10, sender.rowIndex);
    g5.f6 = g5.dataset1.getData(11, sender.rowIndex);
    g5.f7 = g5.dataset1.getData(9, sender.rowIndex);
    g5.f8 = g5.dataset1.getData(6, sender.rowIndex);
    g5.f9 = g5.dataset1.getData(12, sender.rowIndex);
    g5.f10 = g5.dataset1.getData(7, sender.rowIndex);
    g5.f11 = g5.dataset1.getData(8, sender.rowIndex);
    g5.f12 = g5.dataset1.getData(25, sender.rowIndex);
}



//分页处理
g5.pageSize = 10;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}


query();

