taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(ticketInfo.id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "(ticketInfo.flightNumber like '%" + db.encode(searchText) + "%') or " +
        "(airport.code3 like '%" + db.encode(searchText) + "%') or " +
        "(airport.code4 like '%" + db.encode(searchText) + "%') or " +
        "(airport.nameCn like '%" + db.encode(searchText) + "%') or " +
        "(airport.nameEn like '%" + db.encode(searchText) + "%') or " +
        "(airport.cityCn like '%" + db.encode(searchText) + "%') or " +
        "(airport.cityEn like '%" + db.encode(searchText) + "%') or " +
        "(airport_1.code3 like '%" + db.encode(searchText) + "%') or " +
        "(airport_1.code4 like '%" + db.encode(searchText) + "%') or " +
        "(airport_1.nameCn like '%" + db.encode(searchText) + "%') or " +
        "(airport_1.nameEn like '%" + db.encode(searchText) + "%') or " +
        "(airport_1.cityCn like '%" + db.encode(searchText) + "%') or " +
        "(airport_1.cityEn like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT   count(*) as c " +
    "FROM      dbo.ticketInfo LEFT OUTER JOIN " +
    "                dbo.airport AS airport_1 ON dbo.ticketInfo.codeDestination = airport_1.id LEFT OUTER JOIN " +
    "                dbo.airport ON dbo.ticketInfo.codeDeparture = dbo.airport.id " +
    "WHERE (dbo.ticketInfo.status <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT   dbo.airport.code3, dbo.airport.code4, dbo.airport.nameCn, dbo.airport.nameEn, dbo.airport.cityCn, dbo.airport.cityEn, " +
    "                airport_1.code3 AS code32, airport_1.code4 AS code42, airport_1.nameCn AS nameCn2, airport_1.nameEn AS nameEn2, " +
    "                dbo.airport.id as id1, airport_1.id as id2, " +
    "                airport_1.cityCn AS cityCn2, airport_1.cityEn AS cityEn2, dbo.ticketInfo.id, left(CONVERT(varchar(100), dbo.ticketInfo.regDatetime, 20),16) as regDatetime, " +
    "                dbo.ticketInfo.status, dbo.ticketInfo.ticketAmount, dbo.ticketInfo.ticketRemain, dbo.ticketInfo.validDays,  " +
    "                left(CONVERT(varchar(100), dbo.ticketInfo.expireTime, 20),16) as expireTime, dbo.ticketInfo.codeDeparture, dbo.ticketInfo.codeDestination, dbo.ticketInfo.totalCharges,  " +
    "                dbo.ticketInfo.totalAmount, dbo.ticketInfo.totalTaxes, dbo.ticketInfo.flightNumber, left(CONVERT(varchar(100), dbo.ticketInfo.timeDeparture, 20),16) as timeDeparture,  " +
    "                left(CONVERT(varchar(100), dbo.ticketInfo.timeArrival, 20),16) as timeArrival, dbo.ticketInfo.timeDiv, dbo.ticketInfo.note " +
    "FROM      dbo.ticketInfo LEFT OUTER JOIN " +
    "                dbo.airport AS airport_1 ON dbo.ticketInfo.codeDestination = airport_1.id LEFT OUTER JOIN " +
    "                dbo.airport ON dbo.ticketInfo.codeDeparture = dbo.airport.id " +
    "WHERE (dbo.ticketInfo.status <> 'DEL') " + condition + " " +
    " ORDER BY dbo.ticketInfo.id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,
    //0   1             2            3            4          5
    "id,regDatetime,ticketAmount,ticketRemain,validDays,expireTime," +
    //6               7            8           9            10           11        12
    "totalCharges,totalTaxes,totalAmount,flightNumber,TimeDeparture,TimeArrival,TimeDiv," +
    // 13    14    15    16      17     18
    "code3,code4,cityCn,cityEn,nameCn,nameEn," +
    // 19    20       21     22       23     24     25   26  27
    "code32,code42,cityCn2,cityEn2,nameCn2,nameEn2,note,id1,id2", pageSize*(pageCurrent-1), pageSize);

